import "./App.css";
import denverpic from "./assets/img/DenverJam_poster.png";
import guitarpic from "./assets/img/egtr.jpeg";
import Marquee from "react-fast-marquee";
import JotformEmbed from "react-jotform-embed";

import { fontSize } from "@mui/system";

// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyDF2PUn-BXb9FyI6LPH0tHs1Ys0ogFKg4Y",
  authDomain: "denveropenjam.firebaseapp.com",
  projectId: "denveropenjam",
  storageBucket: "denveropenjam.appspot.com",
  messagingSenderId: "348850802720",
  appId: "1:348850802720:web:b8c8657271de3aff5e2c45",
  measurementId: "G-R8DDS8VDF0",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);

function App() {
  return (
    <div className="App">
      <div className="headercontainer">
        <img
          alt="Denver Open Jam - Come Play With Local Musicians"
          className="headerpic"
          src={denverpic}
        ></img>
        <div className="marqueecontainer">
          <Marquee pauseOnHover="true" speed="30" gradient="">
            <span className="scrolltext">* Location and Date TBD *</span>
          </Marquee>
        </div>
      </div>
      <div className="maincontainer">
        <div className="contentcontainer">
          <span>
            JOIN DENVER'S BEST MUSICIANS FOR A NIGHT OF FUN AND RELAXED JAMMING!{" "}
          </span>
          <img
            alt="electric guitar come jam with us Denver Open Jam"
            className="mainpic"
            src={guitarpic}
          ></img>
          <span className="abouttext">
            <div className="headertext">
              <strong>LOOKING TO GET OUT AND PLAY?</strong>
            </div>
            <span className="steptext">STEP 1 </span>
            <span className="desctext">
              Brush the dust off the guitar that's been sitting in the corner
              for two years.
            </span>{" "}
            <br></br>
            -------------------
            <br></br>
            <span className="steptext">STEP 2 </span>
            <span className="desctext">
              Text your friend and ask if they want to join for a night of beers
              and music.
            </span>
            <br></br>
            -------------------
            <br></br>
            <span className="steptext">STEP 3 </span>{" "}
            <span className="desctext">Have an unforgettable night.</span>
          </span>
          <img
            alt="let's party"
            className="dancinggif"
            src="https://funnyordie.com/wp-content/uploads/2021/09/sunny2a.gif"
          ></img>
          <span>
            Ok seriously, just fill out the form below and let us know more
            about you.
          </span>
          <div className="formcontainer">
            <JotformEmbed src="https://form.jotformeu.com/223096537373057" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
